import React from "react";
import {Link} from "react-router-dom";

const UserDashboardNavBar = () => {
    return(
        <div>
            <nav>
                <ul>
                    <Link to="/userdashboardhome"><li>Order</li></Link>
                    <Link to="/userdashboardpending"><li>Pending</li></Link>
                    <Link to="/userdashboardorders"><li>Deliveries</li></Link>
                    <Link to="/userdashboardpayment"><li>Payment</li></Link>
                </ul>
            </nav>
        </div>
    )
}

export default UserDashboardNavBar;
